import React from'react'; 

const doggy =()=>{
    const[activity, setActivity] =React.useState([]);

    React.useEffect(() => {
        const Type="borzoi";
        fetch(
            `https://dog.ceo/api/breed/${Type}/images`
            )
        .then((res)=>res.json())
        .then((json)=>{
            setActivity(json.resulets); 
        })

    },[]);

    return (
        <div className="activity">
            {activity?.map((item)=>(
                <div key={item.id}>
                    <p>{item.actType}</p>
                </div>

            ))}

        </div>
    );


};
export default Activ;
